import React from "react";
import styled from "styled-components";

const MoveFrom = styled.div`
  width: 100px;
  height: 50px;
  float: right;
  text-align: center;
  position: absolute;
  right: 100px;
  background: green;
`;

function MoveForm() {
  return <></>;
}

export default MoveForm;
